import styled from 'styled-components'
import OrderListView from './OrderListView'

const Div = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    height: 95%;
`;

const Sizing = () => {

    return (
        <Div>
            <OrderListView page='Sizing' />
        </Div>
    )
}

export default Sizing
